  .album-display {
    position: relative;
    overflow: hidden;
    background: rgba(0, 0, 255, 0.2);
    height: 100%;

    border: 2px solid #0f0;

    &-images {
      position: absolute;
      top: 0; bottom: 0; left: 0; right: 0;
      display: flex;
      flex-direction: row;
      flex-wrap: nowrap;      
      background: #000;

      &-frame {
